import { useNavigate } from "react-router-dom";
import { Button } from "react-bootstrap";
import { HiArrowNarrowLeft } from "react-icons/hi";
import BaseService from "../service/base.service.tsx";
import * as toastr from "toastr";
import { useState } from "react";

// import { closeModal } from "../../../defultComponent/funPublik";
import { useAppState } from "../service/AppStateContext.tsx";
import { Customers } from "../modules/diners/models/diners";
import CustomersView from "../modules/diners/components/view.component";

let props1
export const OpenModal = (props) => {
    let modal = document.getElementById("myModal").style.display = "block";

    const { state } = useAppState(0);

    const [isReady, setIsReady] = useState(false);
    const [setHasError] = useState(false);
    const [listCustomers, setListCustomers] = useState([], Array(Customers));

    let props1 = props
    console.log(props1)
    BaseService.fetch(`/diners/${props1.id}`).then((rp) => {
        console.log("isReady1", rp.status);
        if (rp.status) {
            const data = rp.data;
            const listCustomers1 = data;
            console.log("isReady1", rp.data);
            setIsReady(true);
            setListCustomers(listCustomers1);
            console.log("isReady2---", isReady, listCustomers1, listCustomers, state);
        } else {
            setIsReady(true);
            setHasError(true);
            console.log("Messages: " + rp.Messages);
            console.log("Exception: " + rp.Exception);
        }
    });

    CustomersView(listCustomers)

}

export const closeModal = (props) => {
    let modal = document.getElementById("myModal").style.display = "none"
}

export const GoBack = () => {
    let navigate = useNavigate();
    return (
        <Button className="px-1"
            onClick={() => navigate(-1)}
            variant="warning"
            title="Back">
            <HiArrowNarrowLeft /> חזור
        </Button>
    )
}

export const View = (props) => {
    console.log("props111111", props)
    return (
        <>
            <button id="myBtn" >
                <img src="https://img.icons8.com/ios-glyphs/30/ab5e2a/visible--v1.png" />
            </button>
        </>
    )
}

export const Reservation = (props) => {
    console.log("props", props)
    return (
        <Button class="iconButton" onClick={() => { window.location.href = `/diners/sit/${props.item.id}/reservation` }}>
            <img src="https://img.icons8.com/ios-filled/30/ab5e2a/meal.png" />
        </Button>
    )
}

export const Payment = (props) => {
    // console.log("ssssssssssssssss", props.item.id, props.item.name, props.item.size,
    // props.item.queue)

    let body = { name: props.item.name, size: (Number(props.item.size)), queue: "awaitingbill" };
    return (
        <button class="iconButton" onClick={() =>
            BaseService.update("/diners/", props.item.id, body).then((rp) => {
                if (rp.Status) {
                    toastr.success("Finance updated", rp.Data);
                } else {
                    toastr.error(rp.Messages);
                    console.log("Messages: " + rp.Messages);
                    console.log("Exception: " + rp.Exception);
                }
                window.location.reload()
            })}>
            <img src="https://img.icons8.com/external-kmg-design-glyph-kmg-design/30/ab5e2a/external-payment-payment-kmg-design-glyph-kmg-design-1.png" />
        </button>
    )
}

export const Completion = (props) => {
    console.log("props.item.id", props.item.id)
    return (
        <button class="iconButton" onClick={() =>
            BaseService.delete('/diners/', idprops.item.id).then((rp) => {
                if (rp.Status) {
                    toastr.success("Finance updated", rp.Data);
                } else {
                    toastr.error(rp.Messages);
                    console.log("Messages: " + rp.Messages);
                    console.log("Exception: " + rp.Exception);
                }
                // window.location.reload()
            })
        }>
            <img src="https://img.icons8.com/ios-filled/30/ab5e2a/checked-checkbox.png" />
        </button>
    )
}

export const Delete = (props) => {
    return (
        <button id="myBtn"
        // onClick={() => openModal({ ...props })}
        >
            <img src="https://img.icons8.com/material/30/ab5e2a/filled-trash.png" />
        </button>
    )
}
